import { createApp } from 'vue';  
import App from './App.vue';
import router from './router'; 

// 按需引入 Vant 组件
import { 
  Button, 
  List, 
  Tabbar, 
  TabbarItem, 
  Dialog, 
  Form, 
  Field, 
  CellGroup,
  NavBar,
  Cell,
  Empty,
  Collapse,
  CollapseItem,
  Tab,
  Tabs,
  Popup,
  List as VanList
} from 'vant';
import 'vant/lib/index.css';

// 按需引入 Element Plus 组件
import { 
  ElButton,
  ElCard,
  ElPageHeader,
  ElTable,
  ElTableColumn,
  ElCollapse,
  ElCollapseItem,
  ElDialog,
  ElTabs,
  ElTabPane,
  ElEmpty
} from 'element-plus';
import 'element-plus/dist/index.css';

const app = createApp(App);
app.use(router);

// 注册 Vant 组件
app.use(Button);
app.use(List);
app.use(Tabbar);
app.use(TabbarItem);
app.use(Dialog);
app.use(Form);
app.use(Field);
app.use(CellGroup);
app.use(NavBar);
app.use(Cell);
app.use(Empty);
app.use(Collapse);
app.use(CollapseItem);
app.use(Tab);
app.use(Tabs);
app.use(Popup);
app.use(VanList);

// 注册 Element Plus 组件
app.use(ElButton);
app.use(ElCard);
app.use(ElPageHeader);
app.use(ElTable);
app.use(ElTableColumn);
app.use(ElCollapse);
app.use(ElCollapseItem);
app.use(ElDialog);
app.use(ElTabs);
app.use(ElTabPane);
app.use(ElEmpty);

app.mount('#app');
